import React from 'react';
import '../css/Home.css';
import CardProfile from './CardProfile';
import {personData} from './personsData';

function Home() {
  return (
    <div className="home-container">
      <div className="home-content">
        <h1 className="home-title">Bienvenido a la Aplicación de Turnos</h1>
        <p className="home-description">
          Esta aplicación te permite gestionar tus calendarios, perfiles y mucho más. 
          Navega a través de las diferentes secciones para explorar todas las funcionalidades.
        </p>
        <CardProfile people={personData} />
      </div>
    </div>
  );
}

export default Home;
